Todos somos diferentes, pero iguales en derechos. 

Compartimos un gran momento con jóvenes con discapacidad que nos contaron en primera persona las dificultades que atraviesan cada día para estudiar, trabajar y hacer deportes, para ser reconocidos y escuchados.

Trabajamos juntas desde el Concejo y el Senado para avanzar en leyes que garanticen todos sus derechos, principalmente en salud y educación. Gracias @rodrigogilmateo @dai_ricardi_13 @joacobaronio1 @germinofranco @nadiaboggiano, Sofia, Renzo, Federico, por compartir sus experiencias. Los vamos a seguir acompañando en este camino de lucha. 

