En villa banana, Rosario viven alrededor de 5.000 personas, que se fueron instalandose desde los años 60. Hoy la vida de sus habitantes cambió por completo porque la villa fue urbanizada. 
Y sus habitantes dicen orgullosos que hoy viven en el Barrio Banana: con calles, veredas, cloacas y luminaria.
Abordar el problema de la infraestructura social básica, cambiar los asentamientos, abrir calles, es indispensable para brindar calidad de vida!!
